  return (
    <section className="home-page">
      <header className="header">
<div className="overlap-group">
            <div className="text-wrapper">Renke Cui</div>
            <div className="nav-bar">
            <div className="works-button">
                <Link
                  to="/Projects"
                  className={`nav-link ${
                    pathname.includes("Projects") ? "active" : ""
